            <div className="wrapper5">
            <h1>Аниматоры на день рождения и детский праздник</h1>
            <div>
            <p></p>
            <p></p>
            <p></p>
            </div>
            <button className="btnCTA">Оставить заявку</button> 
            </div>
        </div>

        <div className="wrapper6">
            <h2 className="titleText">Аниматоры в детский сад</h2>
            <div className="wrapper7">
            {dataAnimators.map((item => {
                const {id,title,age,time,quantity,description,program,price,image1,image2,image3} = item;
                return(
                    <AnimatorsItems title={title} id={id} image={image1}/>
                )
            })
        )}
        </div>
        </div>
        </div>
    )
}

export default ItemDescription;
